  expect ["\u{1F1E6}\u{1F1E7}\u{200D}\u{1F1E8}".u] do "\u{1F1E6}\u{1F1E7}\u{200D}\u{1F1E8}".u.words.to_a end
  expect ["\u{0020}\u{200D}".u, "\u{0646}".u] do "\u{0020}\u{200D}\u{0646}".u.words.to_a end
  expect ["\u{0646}\u{200D}".u, "\u{0020}".u] do "\u{0646}\u{200D}\u{0020}".u.words.to_a end
end
